import React from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Login from './componets/Login'
const App = () => {
  return (
    <Router>
      <Switch>

        <Route path={'/login'} component={Login}/>
      </Switch>
    </Router>
  )
}

export default App
